INSERT INTO "public"."dify_app" VALUES ('34be84ec-0185-4ea8-9003-472738fb414c', '29d181ca-9562-4cc2-a4f3-be605a728143', '智能合同卫士', 'workflow', 'app-RMNjjLGEnt801kigdxzouEzh', 'http://42.194.189.63:8088/v1', NULL, '🤖', '#78ea66', 'normal', 'emoji', '613c0ef6-eee8-4975-92e9-8552d4b12b21', '613c0ef6-eee8-4975-92e9-8552d4b12b21', '智能合同卫士是AI驱动的智能合同审查与生成系统，它能自动扫描合同法律风险，优化条款以最大化主体利益。系统支持生成带修订批注的Word和PDF文件。', '2025-08-18 11:17:34.497814', '2025-08-24 22:35:11.325411');

