-- ----------------------------
-- Table structure for oauth2_registered_client
-- ----------------------------
DROP TABLE IF EXISTS "public"."oauth2_registered_client";
CREATE TABLE "public"."oauth2_registered_client" (
  "id" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "client_id" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "client_id_issued_at" timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "client_secret" varchar(255) COLLATE "pg_catalog"."default",
  "client_secret_expires_at" timestamp(6),
  "client_name" varchar(255) COLLATE "pg_catalog"."default" NOT NULL,
  "client_authentication_methods" text COLLATE "pg_catalog"."default",
  "authorization_grant_types" text COLLATE "pg_catalog"."default",
  "redirect_uris" text COLLATE "pg_catalog"."default",
  "post_logout_redirect_uris" text COLLATE "pg_catalog"."default",
  "scopes" text COLLATE "pg_catalog"."default",
  "client_settings" text COLLATE "pg_catalog"."default",
  "token_settings" text COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."oauth2_registered_client"."id" IS '主键ID';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_id" IS '客户端ID';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_id_issued_at" IS '客户端ID发布时间';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_secret" IS '客户端密钥';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_secret_expires_at" IS '客户端密钥过期时间';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_name" IS '客户端名称';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_authentication_methods" IS '客户端认证方法';
COMMENT ON COLUMN "public"."oauth2_registered_client"."authorization_grant_types" IS '授权类型';
COMMENT ON COLUMN "public"."oauth2_registered_client"."redirect_uris" IS '重定向URI';
COMMENT ON COLUMN "public"."oauth2_registered_client"."post_logout_redirect_uris" IS '登出后重定向URI';
COMMENT ON COLUMN "public"."oauth2_registered_client"."scopes" IS '作用域';
COMMENT ON COLUMN "public"."oauth2_registered_client"."client_settings" IS '客户端设置';
COMMENT ON COLUMN "public"."oauth2_registered_client"."token_settings" IS '令牌设置';
COMMENT ON TABLE "public"."oauth2_registered_client" IS 'OAuth2客户端注册表';

