-- ----------------------------
-- Table structure for plugin
-- ----------------------------
DROP TABLE IF EXISTS "public"."plugin";
CREATE TABLE "public"."plugin" (
  "plugin_id" varchar(100) COLLATE "pg_catalog"."default" NOT NULL,
  "name" varchar(200) COLLATE "pg_catalog"."default" NOT NULL,
  "version" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "description" varchar(1000) COLLATE "pg_catalog"."default",
  "author" varchar(100) COLLATE "pg_catalog"."default",
  "homepage" varchar(500) COLLATE "pg_catalog"."default",
  "type" varchar(20) COLLATE "pg_catalog"."default" NOT NULL DEFAULT 'MODEL'::character varying,
  "status" varchar(20) COLLATE "pg_catalog"."default" NOT NULL DEFAULT 'INSTALLED_DISABLED'::character varying,
  "plugin_path" varchar(1000) COLLATE "pg_catalog"."default",
  "main_class" varchar(500) COLLATE "pg_catalog"."default",
  "provider_source" varchar(500) COLLATE "pg_catalog"."default",
  "provider_interface" varchar(500) COLLATE "pg_catalog"."default",
  "created_at" timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "updated_at" timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "installed_at" timestamp(6),
  "enabled_at" timestamp(6),
  "disabled_at" timestamp(6),
  "icon_path" varchar(255) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."plugin"."plugin_id" IS '插件ID';
COMMENT ON COLUMN "public"."plugin"."name" IS '插件名称';
