DROP TABLE IF EXISTS "public"."sys_login_log";
CREATE TABLE "public"."sys_login_log" (
  "id" uuid NOT NULL,
  "user_id" uuid NOT NULL,
  "ip_address" varchar(50) COLLATE "pg_catalog"."default" NOT NULL,
  "ip_region" varchar(100) COLLATE "pg_catalog"."default",
  "login_time" timestamptz(6) NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "device_type" varchar(20) COLLATE "pg_catalog"."default"
)
;
COMMENT ON COLUMN "public"."sys_login_log"."id" IS '主键ID';
COMMENT ON COLUMN "public"."sys_login_log"."user_id" IS '用户ID';
COMMENT ON COLUMN "public"."sys_login_log"."ip_address" IS '登录IP地址';
COMMENT ON COLUMN "public"."sys_login_log"."ip_region" IS 'IP所在地区';
COMMENT ON COLUMN "public"."sys_login_log"."login_time" IS '登录时间';
COMMENT ON COLUMN "public"."sys_login_log"."device_type" IS '登录终端类型';
COMMENT ON TABLE "public"."sys_login_log" IS '系统登录日志表';

